import styled from 'styled-components';
import { motion } from 'framer-motion';

const PartnershipsSlide = () => {
  return (
    <SlideContainer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <Content>
        <Title>Partnerships & Collaborations</Title>
        <PartnershipList>
          <PartnershipItem>
            <Icon>ü§ù</Icon>
            <PartnershipContent>
              <PartnershipTitle>Crypto Alliances</PartnershipTitle>
              <PartnershipText>Collaborate with Web3 platforms & fintech firms</PartnershipText>
              <DetailsList>
                <Detail>‚Ä¢ Integration with major DeFi protocols</Detail>
                <Detail>‚Ä¢ Cross-chain compatibility partnerships</Detail>
                <Detail>‚Ä¢ NFT marketplace collaborations</Detail>
              </DetailsList>
            </PartnershipContent>
          </PartnershipItem>

          <PartnershipItem>
            <Icon>üíé</Icon>
            <PartnershipContent>
              <PartnershipTitle>Strategic Investors</PartnershipTitle>
              <PartnershipText>Partnerships with major exchanges and blockchain firms</PartnershipText>
              <DetailsList>
                <Detail>‚Ä¢ Top-tier exchange listings</Detail>
                <Detail>‚Ä¢ Blockchain infrastructure partners</Detail>
                <Detail>‚Ä¢ Strategic investment funds</Detail>
              </DetailsList>
            </PartnershipContent>
          </PartnershipItem>

          <PartnershipItem>
            <Icon>üì¢</Icon>
            <PartnershipContent>
              <PartnershipTitle>Influencer Marketing</PartnershipTitle>
              <PartnershipText>Leveraging global music stars & digital influencers</PartnershipText>
              <DetailsList>
                <Detail>‚Ä¢ Afrobeats artist collaborations</Detail>
                <Detail>‚Ä¢ Crypto influencer partnerships</Detail>
                <Detail>‚Ä¢ Global brand ambassadors</Detail>
              </DetailsList>
            </PartnershipContent>
          </PartnershipItem>
        </PartnershipList>
      </Content>
    </SlideContainer>
  );
};

const SlideContainer = styled(motion.div)`
  min-height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  background: ${props => props.theme.colors.background};
  border-radius: 20px;
  margin-bottom: 20px;
  padding: 40px;
`;

const Content = styled.div`
  width: 100%;
  max-width: 800px;
`;

const Title = styled.h2`
  font-size: 3rem;
  margin-bottom: 3rem;
  color: ${props => props.theme.colors.secondary};
  text-align: center;
`;

const PartnershipList = styled.div`
  display: flex;
  flex-direction: column;
  gap: 2.5rem;
`;

const PartnershipItem = styled.div`
  display: flex;
  align-items: flex-start;
  gap: 1.5rem;
  background: rgba(255, 255, 255, 0.05);
  padding: 2rem;
  border-radius: 12px;
  transition: all 0.3s ease;

  &:hover {
    background: rgba(255, 255, 255, 0.1);
    transform: translateX(10px);
  }
`;

const Icon = styled.span`
  font-size: 2.5rem;
  min-width: 50px;
`;

const PartnershipContent = styled.div`
  flex: 1;
`;

const PartnershipTitle = styled.h3`
  font-size: 1.8rem;
  color: ${props => props.theme.colors.secondary};
  margin-bottom: 1rem;
`;

const PartnershipText = styled.p`
  font-size: 1.2rem;
  color: ${props => props.theme.colors.text};
  opacity: 0.9;
  line-height: 1.6;
  margin-bottom: 1rem;
`;

const DetailsList = styled.ul`
  list-style: none;
  margin-top: 1rem;
`;

const Detail = styled.li`
  font-size: 1.1rem;
  color: ${props => props.theme.colors.text};
  opacity: 0.8;
  margin-bottom: 0.5rem;
  line-height: 1.4;
`;

export default PartnershipsSlide;
